import React from 'react';
import { Tabs, Tab } from '@material-ui/core';
import './Home.css';

const Home = () => {
    const [activeTab, setActiveTab] = React.useState(0);

    const handleTabChange = (event, newValue) => {
        setActiveTab(newValue);
    };

    return (
        <div className="home-container">
            <Tabs value={activeTab} onChange={handleTabChange}>
                <div className="tab-wrapper" onClick={() => handleTabChange(null, 0)}>
                    <Tab label="DOCTORS" />
                </div>
                <div className="tab-wrapper" onClick={() => handleTabChange(null, 1)}>
                    <Tab label="APPOINTMENT" />
                </div>
            </Tabs>
            <div className="tab-content">
                {activeTab === 0 && (
                    <div className="doctors-tab-content">
                        {/* Content for Doctors tab */}
                        <h2>DOCTORS</h2>
                        {/* Add your doctor list, filters, and buttons here */}
                        <p>abc</p>
                    </div>
                )}
                {activeTab === 1 && (
                    <div className="appointment-tab-content">
                        {/* Content for Appointment tab */}
                        <h2>APPOINTMENT</h2>
                        {/* Add your appointment list here */}
                    </div>
                )}
            </div>
        </div>
    );
};

export default Home;
